(1, 'About Us', '<p style=\"text-align: justify;\"><br />\r\n<span style=\"color:#000000\"><strong>QUALITY PRODUCT | EXCELLENT SERVICE | INNOVATIVE DESIGNS</strong></span><br />\r\nWe are pleased to introducing HOBEI INTERNATIONAL as one of the leading manufacturers and Exporters of Surgical &amp; Dental &amp; Beauty Equipment incorporated in Pakistan. We are in this business since 1991. We have vast experience in this field. We use best quality raw materials in manufacturing of our products. Our main goals are to supply high quality products with in the aggregated time frame work to our clients. Due to our strongly committed professionalism and specialization of our expertise our prices are very competitive. We wish to do the right things on the very right way at the right time, so that our products confirm by our customers satisfaction. We are too mush committed for our customers satisfaction to provide them quality products on reasonable price.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\"><strong>Hobei International </strong></span>produces skilled labor in manufacturing of our products, totally avoiding child labor.&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\"><strong>We are active member of Sialkot Chamber of Commerce.</strong></span>&nbsp;<br />\r\n&nbsp;<br />\r\nFor more detail information and discussion on the possibilities for initiating business relationship, you are invited to contact us through any means of communications of your choice i.e., through email, what&#39;s app, &nbsp;courier or telephone.&nbsp;<br />\r\nWe assure that we will try our best to make our business relation very beneficial in future.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\"><strong>Management.</strong></span></p>\r\n', '', 'about-us', '1-page.jpg', 'None', 'About Us', 'About Us', 'About Us', 'Yes', '', 1, '', 'About Us', NULL),
(2, 'Contact Us', '<p><span style=\"font-size:18px\"><strong>Hobei International</strong></span></p>\r\n\r\n<p><strong>Address :</strong>&nbsp;Allama Iqbal Town&nbsp;Defense Rd,&nbsp;<br />\r\nHouse# 7&nbsp;District Sialkot 51310 Pakistan</p>\r\n\r\n<p><strong>Cell / What&#39;sapp :</strong>&nbsp;+92-313-715-1616</p>\r\n\r\n<p><strong>&nbsp;Phone:&nbsp; +92-318-725-3949</strong></p>\r\n\r\n<p><strong>Email : </strong>info@hobei-intl.com<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;:&nbsp;hobeiint@gmail.com</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'contact-us', '2-page.jpg', 'None', 'Contact Us', 'Contact Us', 'Contact Us', 'Yes', '', 2, '', 'Contact Us', NULL),
(3, 'Home About Us', '<p>About Us.&nbsp;<br />\r\nQUALITY PRODUCT | EXCELLENT SERVICE | INNOVATIVE DESIGNS<br />\r\nWe are pleased to introducing HOBEI INTERNATIONAL as one of the leading manufacturers and Exporters of Surgical &amp; Dental &amp; Beauty Equipment incorporated in Pakistan. We are in this business since 1991. We have vast experience in this field. We use best quality raw materials in manufacturing of our products. Our main goals are to supply high quality products with in the aggregated time frame work to our clients. Due to our strongly committed professionalism and specialization of our expertise our prices are very competitive. We wish to do the right things on the very right way at the right time, so that our products confirm by our customers satisfaction. We are too mush committed for our customers satisfaction to provide them quality products on reasonable price.</p>\r\n\r\n<p>Hobei International produces skilled labor in manufacturing of our products, totally avoiding child labor.&nbsp;</p>\r\n\r\n<p>We are active member of Sialkot Chamber of Commerce.&nbsp;<br />\r\n&nbsp;<br />\r\nFor more detail information and discussion on the possibilities for initiating business relationship, you are invited to contact us through any means of communications of your choice i.e., through email, what&#39;s app, &nbsp;courier or telephone.&nbsp;<br />\r\nWe assure that we will try our best to make our business relation very beneficial in future.</p>\r\n\r\n<p>Management.</p>\r\n', '', '', '', 'None', 'Home About Us', 'Home About Us', 'Home About Us', 'Yes', '', 3, '', 'Home About Us', NULL),
(4, 'Submit Inquiry', '<p>Thank you for your Inquiry! We will contact with you shortly.............</p>\r\n', '', '', '4-page.jpg', 'None', 'Submit Inquiry', 'Submit Inquiry', 'Submit Inquiry', 'Yes', '', 4, '', 'Submit Inquiry', NULL),
