(6, 'Bottom About us', '<div class=\"footer_heads\">SHORTS ABOUT US</div>\r\n\r\n<p>Manufacturer &amp; Exporter of All kinds of Leather industrial Gloves PPE We are pleased to introduce ourselves as one of the leading and well established manufacturers and exporter of under mentioned products.</p>\r\n\r\n<p>INDUSTRIAL GLOVES:- Industrial Working, welding, Driver, Furniture, Mechanic, Hi-Visibility, Police, Bee keeping and cotton Gloves.</p>\r\n', '', '', '', '', 'Bottom About us', 'Bottom About us', 'Bottom About us', 'Yes', '', 6, '', 'Bottom About us', NULL),
